import React from "react";
import { Layout, Typography, Tabs } from "antd";
import 'antd/dist/antd.css';
import { allEmployees } from "../../mockEmployees"
import EmployeeList from "components/EmployeeList";
import _ from 'lodash';

const { Content} = Layout;
const { Title } = Typography;
const { TabPane } = Tabs;

const DashboardView = () => { 
  const rehireInellgibleEmployees = allEmployees.rehireInellgibleEmployees;
  const rehireUnknownEmployees = allEmployees.rehireUnknownEmployees;

  const groupsRehireEligible = _.groupBy(allEmployees.rehireEligibleEmployees, 'terminated_date');
  var outputRehireEligible =  new Map(Object.entries(groupsRehireEligible));
  outputRehireEligible.forEach((value, key) => {
    console.log(`${key}: ${JSON.stringify(value)}`)
  })

  return (
    <>
      <div>
        <Title level={1} style={{ margin: '0 16px' }}>DASHBOARD</Title>
      </div>
      <Layout className="site-layout">
          <Content style={{ margin: '0 16px' }}>
          <Tabs defaultActiveKey="1">
            <TabPane tab="Rehire Eligible" key="1">              
              {
                outputRehireEligible.forEach((value, key) => {
                  value.map((item, i) => 
                    console.log(`${i}: ${JSON.stringify(item)}`)
                  )
                })
              }

            </TabPane>
            <TabPane tab="Rehire Ineligible" key="2">
              {rehireInellgibleEmployees.map((item, i) => 
                      <>
                        <EmployeeList
                            name={item.name} 
                            designation={item.position}
                        />
                      </>
              )}
            </TabPane>
            <TabPane tab="Rehire unknown" key="3">
            {rehireUnknownEmployees.map((item, i) => 
                      <>
                        <EmployeeList
                            name={item.name} 
                            designation={item.position}
                        />
                      </>
              )}            
            </TabPane>
          </Tabs>
          </Content>

        </Layout>
    </>

  );
};

export default DashboardView;
